import { ADD_SLEEP } from '../actions/sleepActions';

const initialState = {
    sleepEntries: [

    ]
}

const sleepReducer = (state = initialState, action) => {
    console.log(state, action);
    switch (action.type) {
        case ADD_SLEEP:
            return {
                ...state,
                sleepEntries: [
                    ...state.sleepEntries,
                    action.payload
                ]
            }
        default:
            return state;
    }
}
